import React, { Component } from 'react';
import NavigationBar from './components/home/navigationBar';
import HomeLeftPanel from './components/home/homeLeftPanel';
import HomeLeftDownPanel from './components/home/homeLeftDownPanel';
import HomeRightPanel from './components/home/homeRightPanel';
import HomeCenterPanel1 from './components/home/homeCenterPanel1';
import MatchHeader from './components/home/matchHeader';

import { Route, Switch } from 'react-router-dom';
import Feeds from './components/home/homeCenterPanel1';
import Series from './components/series/series';
import Videos from './components/videos/videos';
import Stories from './components/stories/news';
import Ranking from './components/ranking/ranking';

import './App.css';
import './assets/css/home/navigationBar.css';

//import BasicExample from './components/home/BasicExample';

class App extends Component {

  render() {
    return (

      <div className="App">
        <div className="container">
          <div className="row">
            <div className="col-12 pl-2 pr-2">
              {<NavigationBar />}

              <Switch>
                <Route exact path="/" component={Feeds} />
                <Route path="/series" component={Series} />
                <Route path="/videos" component={Videos} />
                <Route path="/Stories" component={Stories} />
                <Route path="/ranking" component={Ranking} />
              </Switch>

            </div>
          </div>

          {/* <BasicExample /> */}
          <div id='HomeLiveMatchHeader' className="row">
            <div className="col-12 pl-2 pr-2 mb-1">
              <MatchHeader />
            </div>
          </div>

          <div id='HomeLeftPanel' className="row">
            <div className="col-lg-2 col-md-2 col-sm-3 col-xs-12 pl-2 pr-0">
              <div>
                <HomeLeftPanel />
              </div>

              <div style={{ marginTop: 4 + "px" }}>
                <HomeLeftDownPanel />
              </div>
            </div>

            <div id='HomeCenterPanel' className="col-lg-7 col-md-7 col-sm-12 col-xs-12 pl-1 pr-1">
              <HomeCenterPanel1 />
            </div>

            <div id='HomeRightPanel' className="col-lg-3 col-md-3 col-sm-3 col-xs-12 pl-0 pr-2">
              <div>
                <HomeRightPanel />
              </div>
            </div>

          </div>
        </div>

      </div>

    );
  }
}

export default App;
